import "./Tours.css";
import Tour from "./tour/Tour";
function Tours(props){
    return(
        <>
        <div className="content">
       {props.data.map((obj,idx)=>{
           return(
        <Tour name={obj.name} 
        image={obj.image} id={idx}/>
           );
        })}
        </div>
        </>
    );
}
export default Tours;
